class LetterState {
  constructor() {
    this.isFound = false;
    this.value = ''; // only availabe if isFound true
    this.cannotHave = [];
  }

  trim() {
    this.cannotHave = [...new Set(this.cannotHave)]
  }
}

const words = getWords();

// f: found char at coorrect place
// p: char at wrong position
// x: word does not contain


/**
 * document.querySelector("#wordle-app-game > div > div > div:nth-child(1 ROW) > div:nth-child(3 COL) > div")
 * getAttribute('data-state'): correct absent empty present
 * starts from 1 and not 0
 */

function generateGameState_nytimes() {
  const games = [];
  for (let r = 0; r < 6; r++) {
    const curGame = [];
    games.push(curGame);
    for (let c = 0; c < 5; c++) {
      const tile = document.querySelector(`#wordle-app-game > div > div > div:nth-child(${r + 1}) > div:nth-child(${c + 1}) > div`);
      const cellState = tile.getAttribute('data-state');
      if (cellState === 'empty') { // scan completed
        games.pop();
        break;
      }
      const value = tile.innerText.toLowerCase();
      const extracted = value + ({ 'absent': 'x', 'present': 'p', 'correct': 'f' })[cellState]
      curGame.push(extracted);
    }
  }
  return games;
}

let mustHave;
let gameState;
let playedWords = new Set()
runner();
function runner() {
  if (document.querySelector("#wordle-app-game"))
    execute();
  else
    setTimeout(runner, 1000)
}

async function execute() {
  await sleep(2000)
  mustHave = generateMustHaveMap();
  gameState = [new LetterState(), new LetterState(), new LetterState(), new LetterState(), new LetterState()]
  console.log(generateGameState_nytimes())
  updateGameState(generateGameState_nytimes());
  trimData();
  const predictedWord = await predictNextMove(words, playedWords)
  if (predictedWord) {
    playedWords.add(predictedWord)
    await playMove(predictedWord);
    await sleep(2000);
  }
  requestAnimationFrame(execute)
}

async function playMove(word) {
  console.log('playing ' + word)
  for (let letter of word) {
    window.dispatchEvent(new KeyboardEvent('keydown', { key: letter }));
    await sleep(150)
  }
  window.dispatchEvent(new KeyboardEvent('keydown', { key: 'Enter' }))
}

function sleep(milliseconds) {
  return new Promise(resolve => {
    const interval = setInterval(() => {
      clearInterval(interval);
      resolve();
    }, milliseconds);
  });
}

function trimData() {
  for (const letterState of gameState) {
    letterState.trim();
  }

  for (let i = 0; i < 26; i++) {
    const key = String.fromCharCode(97 + i);
    mustHave.set(key, [...new Set(mustHave.get(key))])
  }
}

function generateMustHaveMap() {
  const mustHave = new Map();
  for (let i = 0; i < 26; i++) {
    mustHave.set(String.fromCharCode(97 + i), [])
  }
  return mustHave;
}

function updateGameState(games) {
  for (const game of games) {
    let seenLetters = '';
    for (let i = 0; i < 5; i++) {
      const curLetter = game[i][0];
      const curLetterState = gameState[i];
      if (game[i][1] === 'f') {
        curLetterState.isFound = true;
        curLetterState.value = curLetter;
        curLetterState.cannotHave = [];
        mustHave.set(curLetter, []); // remove where it could have been
        removeFromMap(mustHave, i); // remove cur index from all remaining places
      } else if (game[i][1] === 'p') {
        if (!curLetterState.isFound)
          curLetterState.cannotHave.push(curLetter)
        // add the choices this letter has
        for (let j = 0; j < gameState.length; j++) {
          const letterState = gameState[j]
          if (letterState.isFound) continue;
          if (letterState.cannotHave.some(e => e === curLetter)) continue;
          mustHave.get(curLetter).push(j)
        }
      } else if (game[i][1] === 'x') {
        mustHave.set(curLetter, []);
        for (let j = 0; j < gameState.length; j++) {
          const letterState = gameState[j]
          if (letterState.isFound) continue;
          if (seenLetters.indexOf(curLetter) === -1) // new letter
            letterState.cannotHave.push(curLetter);
          // duplicate letter, but for sure cant be at current or old place
          if (j === i || j === seenLetters.indexOf(curLetter))
            letterState.cannotHave.push(curLetter);
        }
      }
      seenLetters += curLetter
    }
  }
}

async function predictNextMove(words, playedWords) {
  let fallbackWord = null;
  out:
  for (const word of words) {
    for (let i = 0; i < 5; i++) {
      const curLetterState = gameState[i]
      if (curLetterState.isFound && word[i] !== curLetterState.value) continue out;
      else if (curLetterState.cannotHave.some(e => e === word[i])) continue out;
      if (!satisfiesMustHave(word)) continue out;
    }
    if (playedWords.has(word)) {
      fallbackWord = word;
      await clearRow();
      continue;
    }
    return word;
  }
  return fallbackWord;
}

async function clearRow() {
  console.log('clearing')
  for (let i = 0; i < 5; i++) {
    window.dispatchEvent(new KeyboardEvent('keydown', { key: 'Backspace' }))
    await sleep(50)
    window.dispatchEvent(new KeyboardEvent('keyup', { key: 'Backspace' }))
    await sleep(50)
  }
  await sleep(250)
}

function predictNextMoves(words, count) {
  const res = [];
  out:
  for (const wordAndFreq of words) {
    const word = wordAndFreq[0]
    for (let i = 0; i < 5; i++) {
      const curLetterState = gameState[i]
      if (curLetterState.isFound && word[i] !== curLetterState.value) continue out;
      else if (curLetterState.cannotHave.some(e => e === word[i])) continue out;
      if (!satisfiesMustHave(word)) continue out;
    }
    res.push(word)
    if (res.length === count) break;
  }
  return res;
}

function satisfiesMustHave(word) {
  for (let i = 0; i < 26; i++) {
    const key = String.fromCharCode(97 + i)
    if (mustHave.get(key).length === 0) continue;
    let satisfies = false;
    for (let position of mustHave.get(key)) {
      if (word[position] === key) {
        satisfies = true;
        break;
      }
    }
    if (!satisfies) return false;
  }
  return true;
}

function removeFromMap(map, num) {
  for (let i = 0; i < 26; i++) {
    const key = String.fromCharCode(97 + i)
    if (map.get(key).some(e => e === num)) {
      map.set(key, map.get(key).filter(e => e !== num))
    }
  }
}

function removeIfPresent(arr, target) {
  return arr.filter(e => e !== target)
}

